INSERT INTO `tiposcontratos` (`id`, `descripcion`, `titulo`, `clausulas`, `usuario_alta`, `fecha_alta`, `usuario_modi`, `fecha_modi`, `created_at`, `updated_at`) VALUES
(1, 'Contrato Mayores de Edad', 'CONTRATO DE SERVICIO EDUCATIVO', '<div style="text-align: justify;"><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;">En Formosa Capital, a los {{CANTIDAD_DIAS}} días del mes de {{MES_TEXTO}} del año de {{ANIO}}; entre <span style="font-weight: bold;">EL INSTITUTO SUPERIOR DE SANIDAD “PROFESOR DOCTOR RAMON CARRILLO”,</span> representado en este acto por el <span style="font-weight: bold;">Señor Representante Legal Dr. OSCAR L. GOMEZ,</span> en adelante <span style="font-weight: bold;">EL INSTITUTO,</span> con domicilio en {{DOMICILIO_INSTITUCION}}, de la provincia de Formosa Capital del mismo nombre; y {{PRONOMBRE_PERSONA}} <span style="font-weight: bold;">{{ALUMNO}}; D.N.I. Nº: {{DNI_ALUMNO}}</span>; en calidad de Alumno en adelante <span style="font-weight: bold;">EL EDUCANDO,</span> con domicilio {{DOMICILIO_EDUCANDO}}; acuerdan en suscribir el presente <span style="font-style: italic; font-weight: bold;">Contrato de Servicio Educativo</span> que se regirá por las cláusulas que a continuación se detallan, a las cuales las partes se someten, obligándose <span style="font-weight: bold;">EL INSTITUTO</span> a notificar con treinta (30) días de anticipación la rescisión del presente Contrato Educativo, cualquiera fuera la causa. Debiendo suscribirse un nuevo Contrato para que el alumno continúe en el establecimiento más allá del Período Lectivo para el que hoy se contrata.</span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><br></span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><span style="font-weight: bold;">PRIMERO: EL INSTITUTO</span> se compromete a brindar enseñanza al alumno durante el presente Ciclo Lectivo {{CICLO_LECTIVO}}, en un todo de acuerdo a los planes de estudio oficiales que aplica el establecimiento o los que en el futuro dispusiere y fueran autorizados oficialmente a aplicar, y las demás actividades extracurriculares que <span style="font-weight: bold;">EL INSTITUTO</span> resuelva implementar.-</span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><br></span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><span style="font-weight: bold;">SEGUNDO: EL EDUCANDO</span> se adhiere al presente contrato en forma completa y se comprometen a cumplir todas las obligaciones establecidas en las reglamentaciones oficiales, en el Código de Convivencia, Reglamento Académico Interno y demás normas y disposiciones emanadas de la Representación Legal y de la Rectoría y Junta Evaluadora de la Institución que hacen a la buena convivencia y las sanas costumbres, así como al asistir cada vez que sea citado por <span style="font-weight: bold;">EL INSTITUTO.</span>- </span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;">Que de existir motivos graves de incumplimiento, por parte de <span style="font-weight: bold;">EL EDUCANDO</span> a los compromisos asumidos en el presente Convenio, serán motivos suficientes para que pueda ser separado del mismo, reservándose <span style="font-weight: bold;">EL INSTITUTO</span> el derecho de admisión y/o de no suscribir un nuevo convenio para el próximo Ciclo Lectivo. En este supuesto <span style="font-weight: bold;">EL EDUCANDO,</span> será notificado fehacientemente emitiéndose la documentación pertinente.-</span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><br></span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2; font-weight: bold;">TERCERO:</span><span style="line-height: 2;"> En contraprestación del Servicio Educativo que recibirá </span><span style="line-height: 2; font-weight: bold;">EL EDUCANDO,</span><span style="line-height: 2;"> se comprometen a abonar a </span><span style="line-height: 2; font-weight: bold;">EL INSTITUTO,</span> <span style="line-height: 2;">un arancel la suma de</span> <span style="line-height: 2;"><span style="font-weight: bold;">{{ARANCEL_TOTAL_TEXTO}}</span> (<span style="font-weight: bold;">{{ARANCEL_TOTAL_NUMERO}}</span>)</span> <span style="line-height: 2;">dividido en {{CANTIDAD_CUOTAS_TEXTO}} ({{CANTIDAD_CUOTAS_NUMERO}}) cuotas mensuales, iguales y consecutivas, pagaderas por adelantado del uno al veinte de cada mes, depositado en la cuenta Bancaria del Banco Provincia de Formosa perteneciente a la Fundación del Hospital de Alta Complejidad Cuenta Corriente N°: 3019/5 CBU: 310000301000000301951; acompañando el comprobante de pago para su registro correspondiente a la administración del Instituto; con vencimiento la primera de ellas en el mes de {{MES_VENCIMIENTO_PRIMER_CUOTA}} del año {{ANIO_VENCIMIENTO_PRIMER_CUOTA}}, y según las modalidades y características que determina </span><span style="line-height: 2; font-weight: bold;">EL INSTITUTO.</span><span style="line-height: 2;"> Reservándose este, la facultad de incrementar unilateralmente el monto de las cuotas, con la sola condición de comunicarlo fehacientemente. Correspondiendo abonar asimismo como condición previa para el ingreso del alumno al periodo por el cual se suscribe el presente contrato a la Institución Educativa la suma de </span><span style="line-height: 2; font-weight: bold;">{{MATRICULA_IMPORTE_TEXTO}} ({{MATRICULA_IMPORTE_NUMERO}})</span><span style="line-height: 2;"> en concepto de </span><span style="line-height: 2; font-weight: bold;">MATRICULA DE </span><span style="font-weight: bold; line-height: 26px;">INSCRIPCION,</span><span style="line-height: 2;"> la cual no será reintegrada en ningún supuesto, ni aun por imposibilidad comprobada y/o desistimiento liso y llano de </span><span style="line-height: 2; font-weight: bold;">EL EDUCANDO,</span><span style="line-height: 2;"> de iniciar sus clases en el establecimiento; previéndose un nuevo abono de dicho concepto (Matricula de Inscripción) durante el presente año lectivo, solo en los supuestos de que se conceda la reincorporación del alumno, al perder este su condición de regular, como consecuencia de la aplicación del Reglamento Académico Interno.</span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><br></span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><span style="font-weight: bold;">CUARTO:</span> Se prevé que para los supuestos de atraso en el pago del arancel, la mora se producirá de pleno derecho, sin necesidad de interpelación judicial o extrajudicial alguna, quedando facultado <span style="font-weight: bold;">EL INSTITUTO,</span> a no computar asistencia en las materias del año en curso, como así también perderá el derecho a rendir exámenes parciales, recuperatorios y exámenes finales a <span style="font-weight: bold;">EL EDUCANDO.</span> Será requisito indispensable de matriculación no adeudar suma alguna de dinero a <span style="font-weight: bold;">EL INSTITUTO,</span> por ningún concepto, conviniendo libremente las partes que a los efectos del cobro de importes adeudados, devinientes del presente contrato, se otorgue a los mismos carácter de Titulo Ejecutivo a todos los efectos procesales en sede judicial.-</span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><br></span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><span style="font-weight: bold;">QUINTO: EL EDUCANDO</span> se compromete, a abonar en concepto de resarcimiento las sumas dinerarias que, a criterio del establecimiento, resulten pertinentes por todo daño que pudiere inferir de manera voluntaria, y/o por su culpa o negligencia; tanto a los bienes propios del establecimiento, como a la integridad psíquica o física de los miembros de la comunidad educativa, en su persona o pertenencias.-</span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><br></span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;"><span style="font-weight: bold;">SEXTO: EL INSTITUTO</span> habilitara los medios para garantizar el dictado de clases durante el ciclo lectivo, consecuentemente mantendrá el libre acceso a sus instalaciones para alumnos y personal docente. Liberando de responsabilidad <span style="font-weight: bold;">EL EDUCANDO</span> a <span style="font-weight: bold;">EL INSTITUTO</span> de las suspensiones o interrupciones de las actividades que se produjeren como consecuencia de medidas de fuerza o acción directa del personal, y caso fortuito o fuerza mayor.</span></div><div style="line-height: 18.5714282989502px;"><span style="line-height: 2;">A todos los efectos legales que pudiera producir el presente contrato, las partes fijan sus domicilios en los enunciados precedentemente, en donde serán válidas todas las notificaciones y diligencias que se practiquen. No pudiendo constituir las partes nuevos domicilios fuera de la Provincia de FORMOSA. Remitiéndose para cualquier controversia que pudiera surgir del presente a los Tribunales Ordinarios de la Provincia de FORMOSA, renunciando las partes en forma expresa al Fuero Federal u otro de excepción que les pudiera corresponder. Suscribiendo las partes de conformidad previa lectura del presente, en dos ejemplares a mismo efecto y tenor.-</span></div></div>', 'driquelme', NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
